class UserController < ApplicationController

  def create
    params[:user][:profile_picture] = ""

   @user = User.new
    data = StringIO.new(Base64.decode64(params[:user][:profile_picture]))
    data.class.class_eval { attr_accessor :original_filename, :content_type }
    data.original_filename = "profile_picture.jpg"
    data.content_type = "image/jpg"
    @user.profile_picture = data
    @user.first_name = params[:user][:first_name]
    @user.last_name = params[:user][:last_name]
    @user.email = params[:user][:email]
    @user.password = params[:user][:password]
      respond_to do |format|
    if @user.save
      format.html {redirect_to :action => "profile" , :id => @user.id}
      format.json {render :json => @json}
    end
    end
  end

  def profile
    @profile = User.where(:id => params[:id]).first
    render layout => false
  end

  def facebook
     if params[:user][:provider]
        @authhash = Hash.new # {"email" => '', "name" => '', "uid" =>'',  "provider" =>''}
        @authhash[:provider] = params[:user][:provider] or ''
          if params[:user][:provider] == 'facebook'
            @authhash[:email] = params[:user][:email] or ''
            @authhash[:name] =  params[:user][:name] or ''
            @authhash[:first_name] =  params[:user][:first_name] or ''
            @authhash[:last_name] =  params[:user][:last_name] or ''
            @authhash[:gender] =  params[:user][:gender] or ''
            @authhash[:facebook_id] =  params[:user][:facebook_id].to_s or ''
            @authhash[:fb_token] = params[:user][:fb_token] or nil
          elsif ['google'].index(params[:provider]) != nil
            @authhash[:email] =  params[:user][:email] or ''
            @authhash[:name] = params[:user][:name] or ''
            @authhash[:uid] = params[:user][:facebook_id].to_s or ''
          else
         # TODO: message that it is not supported
          render root_url
          return
          end

          if @authhash[:facebook_id] != '' and @authhash[:provider] != ''
            params[:user][:profile_picture] = ""

            @data = StringIO.new(Base64.decode64(params[:user][:profile_picture]))
            @data.class.class_eval { attr_accessor :original_filename, :content_type }
            @data.original_filename = "profile_picture.jpg"
            @data.content_type = "image/jpg"
               @auth_service = User.where(:facebook_id => @authhash[:facebook_id]).first
                respond_to do |format|
                  if @auth_service.present?
                    @login_user = @auth_service.update_attributes(:profile_picture => @data,:email=>@authhash[:email],:name => @authhash[:name],:first_name => @authhash[:first_name],:last_name => @authhash[:last_name],:fb_token=>@authhash[:fb_token],:facebook_id=>@authhash[:facebook_id],:provider=>@authhash[:provider], :gender => @authhash[:gender], :last_login_time => Time.now)

                    format.html {redirect_to :action => "profile", :id => @auth_service.id}
                  else

                    @user = User.create
                    @user.update_attributes(:profile_picture => @data,:email=>@authhash[:email],:name => @authhash[:name],:first_name => @authhash[:first_name],:last_name => @authhash[:last_name],:fb_token=>@authhash[:fb_token],:facebook_id=>@authhash[:facebook_id],:provider=>@authhash[:provider], :gender => @authhash[:gender],:last_login_time => Time.now)
                    @user.save!
                    format.html {redirect_to :action => "profile", :id => @user.id }
                     end
               end
       end


    end
  end

   def twitter
     if params[:user][:provider]
        @authhash = Hash.new # {"email" => '', "name" => '', "uid" =>'',  "provider" =>''}
        @authhash[:provider] = params[:user][:provider] or ''
          if params[:user][:provider] == 'twitter'
            @authhash[:email] = params[:user][:email] or ''
            @authhash[:name] =  params[:user][:name] or ''
            @authhash[:screen_name] =  params[:user][:screen_name] or ''
           @authhash[:twitter_id] =  params[:user][:twitter_id].to_s or ''
            @authhash[:fb_token] = params[:user][:fb_token] or nil
          elsif ['google'].index(params[:provider]) != nil
            @authhash[:email] =  params[:user][:email] or ''
            @authhash[:name] = params[:user][:name] or ''
            @authhash[:uid] = params[:user][:facebook_id].to_s or ''
          else
         # TODO: message that it is not supported
          render root_url
          return
          end

          if @authhash[:twitter_id] != '' and @authhash[:provider] != ''
            params[:user][:profile_picture] = ""

            @data = StringIO.new(Base64.decode64(params[:user][:profile_picture]))
            @data.class.class_eval { attr_accessor :original_filename, :content_type }
            @data.original_filename = "profile_picture.jpg"
            @data.content_type = "image/jpg"
            @auth_service = User.where(:twitter_id => @authhash[:twitter_id]).first
                respond_to do |format|
                  if @auth_service.present?
                    @auth_service.update_attributes(:last_login_time => Time.now,:screen_name => @authhash[:screen_name],:profile_picture => @data,:name => @authhash[:name],:twitter_id=>@authhash[:twitter_id],:provider=>@authhash[:provider])
                    format.html {redirect_to :action => "profile", :id => @auth_service.id}
                  else
                    @user = User.create
                    @user.update_attributes(:last_login_time => Time.now,:screen_name => @authhash[:screen_name],:profile_picture => @data,:name => @authhash[:name],:twitter_id=>@authhash[:twitter_id],:provider=>@authhash[:provider])
                    @user.save!
                    format.html {redirect_to :action => "profile", :id => @user.id }
                     end
               end
       end


    end
end
end